description:
Don't miss an opportunity to lease and enjoy this beautifully remodeled spacious 2 bedroom 2 bathroom upstairs apartment!
This lovely home features:
Wood floors in the living room, dining and hallway;
Open floor plan;
Large private balcony off the living room;
Vertical blinds;
Gated entry to a beautifully landscaped and well maintained building;
Laundry room;
Assigned 1 parking space.

Please, TEXT Larisa to schedule a viewing.

1 Year Lease
